import React from "react";
import Panel from "./panel";

const Dashboard = () => {
  return (
    <div className="dshbrd-1">
      <Panel
        classes={["convex"]}
        makaka={{
          container: { flex: "0 0 30%", padding: "10px", height: "300px" },
        }}
      ></Panel>
      <Panel classes={["flx-clmn"]} makaka={{ container: { flex: "0 0 30%" } }}>
        <Panel
          classes={["convex"]}
          makaka={{ container: { flex: "0 0 30%", padding: "10px" } }}
        ></Panel>
        <Panel
          classes={["concave"]}
          makaka={{ container: { flex: "0 0 70%", padding: "10px" } }}
        ></Panel>
      </Panel>
      <Panel makaka={{ container: { flex: "0, 0, 40%" } }} classes={["asdsad"]}>
        <Panel
          makaka={{ container: { flex: "0, 0, 33%" } }}
          classes={["flx-clmn"]}
        >
          <Panel makaka={{ container: { flex: "0, 0, 30%" } }}></Panel>
          <Panel makaka={{ container: { flex: "0, 0, 30%" } }}></Panel>
          <Panel
            makaka={{ container: { flex: "0, 0, 40%" } }}
            classes={["convex"]}
          ></Panel>
        </Panel>
        <Panel
          makaka={{ container: { flex: "0, 0, 33%" } }}
          classes={["flx-clmn"]}
        >
          <Panel
            makaka={{ container: { flex: "0, 0, 40%" } }}
            classes={["convex"]}
          ></Panel>
          <Panel makaka={{ container: { flex: "0, 0, 30%" } }}></Panel>
          <Panel makaka={{ container: { flex: "0, 0, 30%" } }}></Panel>
        </Panel>
        <Panel
          makaka={{ container: { flex: "0, 0, 33%" } }}
          classes={["flx-clmn"]}
        >
          <Panel makaka={{ container: { flex: "0, 0, 30%" } }}></Panel>
          <Panel
            makaka={{ container: { flex: "0, 0, 40%" } }}
            classes={["convex"]}
          ></Panel>
          <Panel makaka={{ container: { flex: "0, 0, 30%" } }}></Panel>
        </Panel>
      </Panel>
      <Panel w="10" h="3" concave={true}></Panel>
      <Panel w="10" h="3" convex={true}></Panel>
    </div>
  );
};

export default Dashboard;
